import Home from "./Pages/Home/Home";
import { Routes, Route,Navigate } from "react-router-dom";

function App() {
  return (
    <>
      <Routes>
        <Route path="/">
          <Navigate to="/home" />
        </Route>
        <Route path="/home">
          <Home />
        </Route>
      </Routes>
      <Routes>
    <Route path="/" element={<Home />} />
    <Route path="/lab" element={<Lab />} />
    <Route
        path="*"
        element={<Navigate to="/" />}
    />
  </Routes>
    </>
  );
}

export default App;
